import React from 'react';

const FooterAluno = () => {
    return (
        <footer className='text-center'>
                {{  
                    position : 'fixed',
                    left: 0,
                    bottom: 0,
                    width: '100%'
                }}
            <h1> Projeto EDUX </h1>
            <small> Desenvolvido por Grupo 8 </small>
        </footer>
    )
}

export default FooterAluno;
